import React from 'react'
import './MeetingTime.css'

//startTime used for styling (not actually needed since timer keeps going forever)
const MeetingTime = (props: {visible:boolean }) => {
    const toggleVisible = () => {
        props.visible = false;
    }
    return (
        <div className="popup" style = {{display: !props.visible? 'none':''}}> Meeting Length:
        <button className = "xOut" onClick = {toggleVisible}>x</button>
        </div>
    )
}


export default MeetingTime;
